            "categoryPath": "Home/Appliances/Vacuums & Floor Care/Upright Vacuums",
            "shortDescription": "The Hoover Air Lift lets you go from the deep cleaning power of an upright to the portability of a canister with continuous performance and convenience. Its detachable lift canister takes power and performance from carpet and hard floors to stairs, ceilings and other hard-to-reach areas with one touch. It includes a Pivoting Dusting Brush for fans, a Turbo Tool and Crevice Tool for detailed cleaning. Powered by WindTunnel 3 Technology and no loss of suction, Air Lift gives you lift canister convenience with uncompromised performance.",
            "longDescription": "&lt;br&gt;&lt;b&gt;Hoover Air Lift Bagless Upright Vacuum, UH72510:&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt;Features:&lt;/b&gt;&lt;ul&gt;&lt;li&gt;Detachable lift canister goes from an upright vacuum to a lift canister for cleaning stairs, ceilings and hard-to-reach areas&lt;/li&gt;&lt;li&gt;Exclusive WindTunnel 3 Technology creates three channels of suction to lift and remove surface debris and deep down embedded dirt&lt;/li&gt;&lt;li&gt;Extended cleaning reach goes from floors to ceiling with a removable wand and tools&lt;/li&gt;&lt;li&gt;Multi-Floor on/off Brushroll instantly switches from carpet to hard floor cleaning with the touch of a button&lt;/li&gt;&lt;li&gt;AllergenBlock Technology blocks* 99 percent of pet dander, dirt, dust and pollen particles from reentering the air&lt;/li&gt;&lt;li&gt;Multi-Cyclonic Technology filters captured dirt and debris for constant powerful suction with no loss of suction (1)&lt;/li&gt;&lt;li&gt;Auto Height Adjust automatically adjusts to any carpet height for optimal cleaning&lt;/li&gt;&lt;li&gt;Steerable Technology maneuvers around furniture, corners and other obstacles by simply moving the handle&lt;/li&gt;&lt;li&gt;5-year limited warranty&lt;/li&gt;&lt;/ul&gt;&lt;b&gt;Includes:&lt;/b&gt;&lt;ul&gt;&lt;li&gt;1 Bagless Upright Vacuum&lt;/li&gt;&lt;li&gt;1 Crevice Tool&lt;/li&gt;&lt;li&gt;1 Turbo Tool&lt;/li&gt;&lt;li&gt;1 Pivoting Dusting Brush&lt;/li&gt;&lt;li&gt;1 Telescoping Wand&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;i&gt;(1) Per IEC 60312-1 1st Edition, Clause 5.9&lt;br&gt;&lt;br&gt;*Based on ASTMF1977 using particle sizes down to 0.5 microns&lt;/i&gt;",
